INSERT INTO designs VALUES (826783, 'NCT03299400', NULL, 'Single Group Assignment', NULL, 'Diagnostic', NULL, 'None', NULL, 'All eligible patients who have given informed consent will attend the ophthalmology clinic for screening.Patient will undergo general anaesthesia for prone spinal surgery. The degree of inclination was set prior to the start of the case and independently confirmed using a goniometer. Patients will be placed in the prone position on a Jackson Spine table.Once positioned, the head is carefully placed on the GentleTouch prone positioning pillow of the appropriate size.Patient will continue to wear the contact lens postoperatively for a total of 24 hours or until the patient cannot tolerate the contact lens. After removal of the contact lens sensor, the recorded profiles will be collected and visualized graphically on a computer interface. The output of the sensor expressed in voltage, and can be analysed in real time points corresponding to the intraoperative events.', NULL, NULL, NULL, NULL);
