INSERT INTO designs VALUES (827047, 'NCT03295968', 'Randomized', 'Crossover Assignment', NULL, 'Basic Science', NULL, 'Single', 'Water control and ibuprofen solution contained 0.8 g of Sucralose (Heartland Food Products Group, Amsterdam, HP, Netherlands) and 1.2 g of orange flavored Kool-Aid (Kraft Foods, Northfield, IL, United States) to mask the taste of the Motrin solution. To match sweetness and calorie content of the ibuprofen Motrin drink, the water control also contained 6 mL high fructose corn syrup (ACH Food Companies, Mississauga, ON, Canada).', 'Fifteen normal-weight boys (aged 13-18y) were randomly assigned in a crossover design to four sessions: 1) Water + Rest; 2) Rest + ibuprofen; 3) Water + high intensity exercise; 4) high intensity exercise + ibuprofen. High intensity exercise consisted of three 10min bouts of high intensity exercise at 75% VO2peak at 60-70RPM with 1:30min active rest interposed. IBU was given in a 300mg liquid solution. EI, visual analog scale ratings and plasma biomarkers of appetite, inflammation, stress and glucose control were measured.', true, NULL, NULL, NULL);
