INSERT INTO designs VALUES (827591, 'NCT03288896', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'A Cluster Randomized Controlled Trial is conducted to test the effectiveness of Alerta Alcohol in students aged 16 to 18 years. The study is performed in 16 high schools from Andalusia (southern Spain), which are randomized either to the experimental or the control condition (EC and CC). The EC receives the Alerta Alcohol intervention, which consists of four sessions at school. The adolescents are provided highly specific feedback regarding their knowledge, risk perception, self-esteem, attitude, social influence, and self-efficacy. In addition, two booster sessions are given at home to reinforce the contents of the three scenarios. The CC just completes the baseline and the evaluation questionnaires and then they are allowed to receive the intervention as well (as a waiting list control condition).', NULL, NULL, NULL, NULL);
