INSERT INTO designs VALUES (827910, 'NCT03284749', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Quadruple', 'After inclusion all patients will be randomised for a wound dressing or maternity pad with (study group) or without copper (control group). The two sets of wound dressings and pads will be marked "A" or "B". Both the clinician and the patient will be blinded to the randomised group. Only the manufacturer will be aware of which group contains copper.', 'All women are randomised to either the copper or the control group. Randomisation will be done separately for the caesarean section and vaginal delivery group.', true, true, true, true);
