INSERT INTO designs VALUES (827911, 'NCT03284736', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'Both the participant and primary investigator are blinded in the study until whole surgical procedure is completed and before suturing the flap.', 'A total number of 15 patients in each group were selected. Patients were randomly allocated by computer program into two group. Clinical and radiographic examinations were performed every 3, 6 and 12 months by assessing the same parameters as baseline except that PD, CAL, and GMP were measured until 12 months. Routine examination procedure were used to evaluate any evidence of signs and/or symptoms. Jig radiographs were taken at 3, 6 and 12th month of follow up. Inter and intra observation of data will be analyzed by distribution of data. Categorical data will be analyzed by chi square test. Regression analysis will be done to observe any association between independent and dependent variables. Interobserver/intraobserver reliability with cohen kappa analysis.', true, NULL, true, NULL);
