INSERT INTO designs VALUES (828234, 'NCT03280524', 'Randomized', 'Parallel Assignment', NULL, 'Supportive Care', NULL, 'Double', 'To ensure the blinding, the study included an interventionist enabled for application of foot reflexology.', 'The patients will be taken to a room reserved for the procedure. First, the patients answer the research instruments and then they will be asked to lie supine on a stretcher. The feet of the patients will be cleaned with water (37ºC) and mild soap and then will be dry with paper towels. The next phase consists in the application of foot massage, that will follow the Lourenço''s Protocol (2012), which consists of 14 steps of relaxation massage. Each step will have duration of 1 minute, 3 procedures by week, by 4 consecutive weeks. The research instruments, SF-36 and Stanford Health Assessment Questionnarie will be applied before the first and after the last procedure.', true, NULL, true, NULL);
