INSERT INTO designs VALUES (1166508, 'NCT03315442', 'Randomized', 'Parallel Assignment', NULL, 'Screening', NULL, 'None', NULL, '20 healthy adults, (11 males; 9 females) averaging 26.1 years of age, stood on a MatScan pressure mat, which measured center of pressure (CoP), anteroposterior (AP) and mediolateral (ML) postural sways during eight different balance tests (BALT''s). BALT''s were designed to alter or cancel the systems involved in postural control: visual, vestibular and somatosensory. Subjects were randomly assigned to a caffeine group and an energy drink group. MANOVA analysis was performed for all variables of interest.', false, false, false, false);
