INSERT INTO designs VALUES (829118, 'NCT03269006', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'A randomized control trial will be performed with Inesfly 5AIGRNG TM, commercial available durable wall lining (DWL), impregnated of existing bed-net with insecticide tablet, KO TAB 123, indoor residual spraying (IRS) with Delthamethrin vs a control group (study with 5 arms). The study will be carried out in villages located in Mymensingh District. Four high endemic villages will be selected for the study. As per sample size calculation we need minimum 31 households to see the efficacy of the interventions. We will include 50 households for each intervention and 50 for control (No intervention). 18 households from each cluster will be selected randomly for entomological analysis which includes sand fly density measurement at base line and 1, 3, 6, 9, 12, 15, 18, 21 and 24 months after intervention, and WHO Cone bio-assay on the intervention surfaces and the control surfaces at 1, 3, 6, 9, 12, 15, 18, 21 and 24 months after intervention.', NULL, NULL, NULL, NULL);
