INSERT INTO designs VALUES (829540, 'NCT03263520', 'Randomized', 'Parallel Assignment', NULL, 'Supportive Care', NULL, 'Double', 'The outcomes assessor and investigator does not have contact with the patient or care provider at the moment of randomization and the study purpose. The investigator just apply the bioelectrical impedance analysis and helps the patient about doubts on the Quality of Life questionnaire of EORTC ( QLQ-C30)', 'Randomization will be made at the time of study enrollment by , where patients randomly selected as even number will be included in group 1 and those selected as odd number in group 2Group 1 (G1): the patient will receive an application of anabolic nandrolone decanoate at a dose of 50 mg (males) and 25 mg (females), intra-muscular form, in the first and fifteenth days. In addition to the anabolic steroid, the patient will use corticosteroids (dexamethasone) at home at a dose of 4 mg daily for both sexes.Group 2 (G2): The patient will use corticosteroids (dexamethasone) at a dose of 4 mg daily.', NULL, NULL, true, true);
