INSERT INTO designs VALUES (829663, 'NCT03261921', 'Randomized', 'Factorial Assignment', NULL, 'Diagnostic', NULL, 'Triple', 'The Patients allocated to study groups using computer generated random list & group assignment was sealed in sequentially numbered opaque envelopes that opened after induction of anesthesia.', 'Sixty-three patients with ASA I-II aged from 1-6 years scheduled for hypospadias surgery in Abu El-Resh pediatric Hospital-Cairo university, were included in this prospective randomized double-blinded clinical study. Patients with contraindication to caudal anesthesia, cardiovascular diseases, drug allergy, type I diabetes, clotting disorders, mentally retarded children or those whose families did not approve inclusion in the study were excluded from the study.Patients were randomly divided on the morning of surgery into three groups group I( dexamethasone 21 patients), Group II ( Dexmedetomidine 21 patients) and group III(Dexmedetomidine and dexamethasone 21 patients).', true, true, true, NULL);
