INSERT INTO designs VALUES (829685, 'NCT03261635', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'This was a prospective, randomized, pilot study in 58 patients with naï ve CNV. Patients were randomized 1:1 into 2 groups: ranibizumab monotherapy (RM group) and ranibizumab plus indomethacin (RI group). All patients received monthly 0.5 mg ranibizumab intravitreal injections for 3 months, after which monthly injections were administered pro re nata. RI patients also self- administered one drop of indomethacin three times a day for 12 months. All patients were followed up for 12 months.', NULL, NULL, NULL, NULL);
INSERT INTO designs VALUES (829686, 'NCT03261622', 'Randomized', 'Parallel Assignment', NULL, 'Basic Science', NULL, 'Double', 'Alle patients are stimulated sub-sensory in (3x4 weeks) and will be blinded. The investigators will not participate in the randomization, and setting of the stimulation amplitude.', 'Patients will be randomized to either control group (Stimulation amplitude at 90% of sensory threshold) or intervention arm (different stimulation amplitude - 0.05 V, 50 and 90% of sensory threshold)', true, NULL, true, NULL);
