INSERT INTO designs VALUES (829978, 'NCT03257813', 'Randomized', 'Crossover Assignment', NULL, 'Treatment', NULL, 'Double', 'Masking will be carried out using identical boxes in the primary package in both groups.Blinding for the research subject and the investigator will be carried out by using labels containing the assignation number, which will replace the original labels in the case of the comparator. Due to the nature of the primary containers of the research products, single-dose vials and multidose bottle, it is not possible to use identical labels.', '60 subjects with diagnosis of open angle primary glaucoma with mild, moderate or severe damage and / or with intraocular hypertension users of Krytantek Ofteno® at least two previous months and are under control Of the corresponding IOP target.a study group A or B will be randomly assigned, in group A, therapy with Krytantek Ofteno® will be continued for 30 days, in which the subject will be evaluated again and switched from therapy to solution PRO-122 which will be used for 30 days until the 60th day, date of the final visit.In the case of those assigned to group B on day 1, the change to PRO-122 solution will be made for 30 continuous days until the date of revision on day 30, the day on which treatment with Krytantek Ofteno® will be restored to continue until the Day 60 for the final evaluation.The selected subjects will be observed for 60 days.', true, NULL, true, NULL);
