INSERT INTO designs VALUES (830085, 'NCT03256409', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Single', 'The working protocol for determining the BOD Ra and BJOD Ra and the adhesion of molds and yeasts and mesophyll aerobics was carried out entirely by an investigator and the following working methodology was considered: Information to the patient and obtainment of clinical data and patient informed consent. Patients were randomly assigned to group 1 and group 2. The saliva sample was obtained in each patient for the microbiological before the installation of the overdentures. BODs and BJODs were installed in each patient and according to each case. The BOD and BJOD were removed at 30 days for surface roughness evaluation (Ra:m) and the evaluation of the adhesion of mold and yeast and mesophyll aerobe (CFU/ml). For the study at 180 days the BODs and the BJODs were installed in each patient. BODs and BJODs were removed after this time to proceed to the evaluation of surface roughness and adhesion of mold and yeast and mesophyll aerobe under the same parameters mentioned above.', 'The study presents the results of a sample of ten patients randomly assigned to receive implant-retained overdentures and divided into two parallel groups of five participants in a single-blind trial at a follow-up period of 30 - 180 days permanence in the mouth. Five overdentures were made for each group: Group 1: BOD: five systems titanium bar CARES® and synOcta® Straumann® Dental Implant System, Holding AG Inc., Basel, Switzerland (BOD). Group 2: BJOD: five systems ball joint Klockner® Implant System; Soadco Inc., Escaldes-Engordany, Andorra were used in two parallel groups of five participants, in an essay to simple blind person.', NULL, NULL, true, NULL);
