INSERT INTO designs VALUES (830139, 'NCT03255707', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'Patients of the study will be recruited from the ophthalmology outpatient clinic of Ain Shams University Hospital.100 patients of both sexes with amblyopia will be enrolled. Informed consents will be obtained from adult patients and children''s parents.Patients will be assigned randomly:Group A:50 patients will receive the gold standard occlusion therapy while playing a video game (Lazy Eye Tetris games such as Lazy Eye Blocks ®).Group B:50 patients will receive dichoptic treatment in the form of playing a video game (Lazy Eye Tetris games such as Lazy Eye Blocks ®) while wearing a red/green goggle.Each group will be subdivided according to age:1)4 to 7 years. 2)>7 to 12 years. 3)>12 to 30 years.Hours of occlusion /dichoptic treatment will be classified according to the degree of amblyopia:Mild to moderate amblyopia (Best corrected visual acuity (BCVA)< 0.2) : 2-4 hoursSevere (BCVA> 0.2) : 4-6 hoursAll patients will undergo full ophthalmological examination', NULL, NULL, NULL, NULL);
