INSERT INTO designs VALUES (830216, 'NCT03254706', 'Randomized', 'Crossover Assignment', NULL, 'Treatment', NULL, 'Double', 'A staff member not involved in the research protocol performed the randomization process with computer-generated tables. Details of the allocated groups were recorded on cards contained in sequentially numbered, opaque, sealed envelopes. Opening the envelope only on the day of the restorative procedure guaranteed the concealment of the random sequence. The examiners were not involved with the restoration procedures and therefore blinded to the group assignment, performed the clinical evaluation. Patient were also blinded to group assignment in a double-blind randomized clinical trial design.', 'This was a double-blind, superiority, split-mouth randomized clinical trial. The study was carried out in the clinics of the School of Dentistry at the local University from August 2015 to August 2017.', true, NULL, NULL, true);
INSERT INTO designs VALUES (830217, 'NCT03254693', 'Randomized', 'Crossover Assignment', NULL, 'Other', NULL, 'Double', 'staff member not involved in the research protocol performed the randomization process with computer-generated tables. Details of the allocated groups were recorded on cards contained in sequentially numbered, opaque, sealed envelopes. Opening the envelope only on the day of the restorative procedure guaranteed the concealment of the random sequence. The examiners were not involved with the restoration procedures and therefore blinded to the group assignment, performed the clinical evaluation. Patient were also blinded to group assignment in a double-blind randomized clinical trial design.', 'This was a double-blind, equivalence superiority, split-mouth randomized clinical trial. The restoration procedures were carried out within the clinics of the Dental School of the Federal University of Rio de Janeiro in Rio de Janeiro (Rio de Janeiro, Brazil) and at the State University Oeste do Paraná in Cascavel (Paraná, Brazil) from July 2016 to August 2017.', true, NULL, NULL, true);
