INSERT INTO designs VALUES (830621, 'NCT03249441', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Single', 'Clients are randomly assigned to one of two groups, Treatment as Usual (TAU) or Compassion-focused therapy plus Treatment as Usual (CFT). The outcomes assessor is blind to which of the two groups participants are assigned to.', 'This study utilised a randomised controlled trial (RCT) research design to investigate the efficacy of a group based CFT intervention programme. Participants were randomly allocated to one of the two groups, CFT plus Treatment as Usual (CFT) or Treatment As Usual (TAU), and psychological measures were administered at three time points (pre-intervention, post-intervention and follow-up assessment at three months follow up). The primary outcomes included self-compassion, shame and self-criticism. Emotional eating and depressive symptoms were assessed as secondary outcomes.', NULL, NULL, NULL, true);
