INSERT INTO designs VALUES (830813, 'NCT03246945', 'Randomized', 'Parallel Assignment', NULL, 'Diagnostic', NULL, 'Double', 'Dermatologist providing remote diagnosis was blinded to whether parents were provided instructions, which phone they took and the diagnosis provided by the in-person dermatologist', 'Patient/parent dyads visiting a pediatric dermatology clinic were invited to participate. After consent, patient/parent dyads were randomly assigned to photography instruction versus no instruction. In both arms, parents photographed their child''s skin condition (via smart phone) and provided medical history. Images were uploaded securely to the child''s electronic health record for independent diagnosis by a dermatologist not involved in the patient''s care.', NULL, true, true, NULL);
