INSERT INTO designs VALUES (831232, 'NCT03241498', 'Randomized', 'Single Group Assignment', NULL, 'Health Services Research', NULL, 'Single', NULL, 'A prospective, multi-centre, randomised intervention study will be conducted simultaneously in four different regions of the United Kingdom (UK), namely:Northern Health and Social Care Trust (NHSCT) and Western Health and Social Care Trust (WHSCT), Northern IrelandNorth West Coast Academic Health Science Network (AHSN), EnglandWessex AHSN, EnglandEastern AHSN, EnglandTwo GP practices will participate in the research in each of these four geographical areas. The pragmatic sample size at each site will be 50 intervention patients and 50 control patients completing a six month follow-up period i.e. a total of 800 patients (400 intervention and 400 control patients) across the eight participating GP practices. An over-recruitment of 20%, i.e. 60 each of both control and interventions patients per practice, will be recruited into the study to take account of patients who drop out of the study and/or are lost to follow up.', NULL, NULL, NULL, true);
