INSERT INTO designs VALUES (831514, 'NCT03237832', 'Randomized', 'Parallel Assignment', NULL, 'Health Services Research', NULL, 'Quadruple', 'The pharmacist preparing the doses was unblended and was responsible for all drug accountability issues, including preparing, labeling, and dispensing study drug according to the randomization code provided. The unblinded pharmacists were responsible for maintaining the blind, consistent with protocol design, throughout the study. All documentation was filed in the Pharmacy Manual, and access to this manual was restricted to the unblinded pharmacists. The subjects, Principal Investigator, and all other personnel involved with subject assessments were blinded to the actual treatment assignments of the subjects (ARN-6039 or placebo) during the study.', 'Determine safety and tolerability of ARN-6039 ascending doses compared to placebo', true, true, true, true);
