INSERT INTO designs VALUES (831577, 'NCT03237013', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'At initial visit, participants were screened for study eligibility, consented, and randomized to a study condition. Participants first completed baseline assessment. Following, all participants completed intervention as determined by randomized assignment (i.e., control, facial morphing or mindfulness). At the initial visit, all subjects were assigned a subject ID number. Each subject ID was pre-assigned to a study condition, determined by an online randomization program, prior to recruitment. Each eligible participant had a 1/3 chance to be assigned to each of the three study conditions. Immediately after intervention, participants completed acute assessment, also consisting of self-report questionnaires. At the end of the initial visit, participants provided researchers a valid email address to be sent a subsequent follow-up survey. Approximately one month from the intervention date, participants received and completed the online follow-up survey.', NULL, NULL, NULL, NULL);
