INSERT INTO designs VALUES (831661, 'NCT03235921', 'Non-Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'To avoid significant hypotension during nitroglycerin administration, each patient was evaluated for adequate intravascularvolume as evidenced by repeated volume challenges(250 mL of crystalloid over 10 minutes) up to appoint at which central venous pressure raised by more than 2 mmHg.When the systolic blood pressure reaches 90mmHg or more we can apply the nitroglycerin patch of 2.5 mg alongside with continuous resuscitation the dose can be doubled according to the change in the peripheral perfusion parameters. Time between administration of nitroglycerin patch and peak of its action will be calculated.Nitroglycerin patch will be removed if the patient developed significant hypotension (mean arterial pressure of less than 50 mm Hg ) however its action may persist up to 45minutes after removal.During the study, infusion rates of noradrenaline or other vasoactive drugs were not changed and no additional fluids were administered.', NULL, NULL, NULL, NULL);
