INSERT INTO designs VALUES (832466, 'NCT03225430', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'Assessors will receive no information on participant history and psychopathology. All evaluation sessions will be audio-recorded for reliability and to ensure that treatment status is not divulged. The Assessors will be separated from the therapists by geographical location site and will sign agreements not to discuss cases in the study with any other team member. Child and adult participants will agree not to discuss treatment or therapy during evaluation. Management of assessors will be delegated to a separate clinical coordinator who will assume overall responsibility for evaluations and preempting any direct contact between the principal investigator and Co-investigators and the assessors.', NULL, NULL, NULL, true, true);
