INSERT INTO designs VALUES (832510, 'NCT03224858', 'Randomized', 'Parallel Assignment', NULL, 'Health Services Research', NULL, 'Triple', 'Participants, care providers, investigator, and initial trained research assistant will be blinded initially during consent and baseline interview survey procedures. Once, randomization has occurred, the participants, care provider, investigator, and subsequent outcomes assessor will not be blinded.', 'This is a pragmatic "wait-list" control design. Participants will be consented and baseline survey administered after which patient will be randomized by computer generated algorithm into 2 arms: immediate or 6-month ''wait-list.'' Immediate group will start intervention and be followed at 6 month intervals for 12 months. ''Wait-list'' group will resume usual care for 6-months, after which they will cross-over to the intervention group for 12 months.', true, true, true, NULL);
