INSERT INTO designs VALUES (832575, 'NCT03224013', 'Non-Randomized', 'Parallel Assignment', NULL, 'Other', NULL, 'None', NULL, 'Interventional prospective consecutive comparative case control series of cases; 50 eyes of 25 patients with mean age 35.7 ± 12.4 (Range 18-61years) with hyperopia or hyperopic astigmatism underwent customized LASIK with concurrent prophylactic high-fluence cross-linking in right eye (group 1) and customized LASIK only in left eye (group 2). Cases with hyperopia +1D to +6D or hyperopic astigmatism up to 4D were included in the study. Patients with previous intraocular or corneal surgery, active corneal disease were excluded from the study.Main outcome measures were uncorrected visual acuity (UCVA), manifest refractive spherical equivalent (MRSE), cycloplegic refractive spherical equivalent (CRSE), keratometric measurments and spherical aberrations at 4 mm and maximum pupilnand their ecolution along 6 months postoperatively.', NULL, NULL, NULL, NULL);
INSERT INTO designs VALUES (832583, 'NCT03223909', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'The double-blind study is a procedure in which the patient and the treating doctor ignore to which intervention group the study patient was assigned. To achieve the blinding of both the drug in research and both comparator drugs, these will be labeled in the same way (masking). Besides the figure of an unblinded pharmacist, who is responsible for the delivery of the medication to the patient, will be added. Blinding codes are protected by an outsider appointed by the study sponsor. The codes are also available in the research center (fully sealed), so that they can be consulted by the investigator in case a subject presents a serious adverse event, prior authorization from the study sponsor; the blinding also continues rigorous during the data analysis and interpretation.', 'Controlled, double-blind, randomized, clinical trial comparing the safety and efficacy parameters between a group of subjects with a diagnose of mild to moderate tear film dysfunction syndrome under a regimen of ophthalmic solution lubricant drops PRO-087 versus subject under Systane® Ultra or Systane® Ultra preservative free, with the same diagnosis, with a follow-up of 90 days.', true, NULL, true, NULL);
