INSERT INTO designs VALUES (832762, 'NCT03221569', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Triple', 'Aside from primary investigator (B.Sin) and pharmacist procuring the study interventions, blinding will be applied to patient, physicians, nurses, research associates responsible for collect data and also the independent biostatistician responsible for evaluating the data. Patients will be randomized to receive study numbers that corresponds to treatment arms.', 'Arm A would include 1 mg/kg intranasal ketamine and a 50 cc normal saline IV bag while Arm B would receive placebo intranasal dose and Metoclopramide 10mg/Diphenhydramine 25mg mixed in 50 ccs normal saline. For intranasal administration, the total volume of the dose will be administered in equivalent half volumes in each nare. For example, if the total dose equated to 1ml, the patient would receive 0.5ml in the left nare and 0.5ml in the right nare. A maximum dose of 1 ml will be given per nare. If the total dose exceeds 1 ml, this will be divided into two syringes, the volume above 1ml will be administered 2-3 minutes after administration of the initial volume.', true, true, NULL, true);
