INSERT INTO designs VALUES (834070, 'NCT03204513', 'Randomized', 'Crossover Assignment', NULL, 'Device Feasibility', NULL, 'None', NULL, 'Upon screening and enrollment participants return for up to 8 prosthetic fitting sessions and up to 12 physical therapy training sessions using their own microprocessor (MP) knee prosthesis and the powered knee-ankle (PKA) prosthesis. Once training is complete participants will return for up to 6 post-training assessment sessions per device. The device participants begin with will be randomly selected but there will be equal opportunity to train with both devices. In between training, there will be an 8 week "wash out period" to allow normalization to use of the device, reducing carryover effects. After wash-out period protocol will be repeated with second device.', NULL, NULL, NULL, NULL);
INSERT INTO designs VALUES (834071, 'NCT03204500', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'This is a prospective randomized double-blind placebo-controlled trial. The randomization is made in blocks of 4 treatments (2 active and 2 placebo). Only the 4-digit numbers on the bottle label will identify the type of treatment.', 'Twenty ALS patients under active treatment vs. twenty ALS patients under placebo treatment. 21 months follow-up whith clinimetry and biomarkers', true, NULL, true, NULL);
INSERT INTO designs VALUES (834072, 'NCT03204487', NULL, 'Single Group Assignment', NULL, 'Treatment', NULL, 'None', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO designs VALUES (834076, 'NCT03204435', 'Non-Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Single', NULL, 'Patients of intracranial aneurysms with coexistence of cerebrovascular stenosis, coincident with inclusion and exclusion criterion, will be distributed into traditional therapy group(control group) and hybrid operating group(test group), and conduct with traditional neurosurgical management or one-stage hybrid operating management separately.Traditional therapy group: intervene the aneurysms and vascular stenosis unsimultaneously. Clipping procedure is preferred to aneurysms, while endovascular intervention is preferred to stenosis.Hybrid operation group: one-stage hybrid operating technique is conducted. The aneurysms and vascular stenosis will be executed via the cooperation of microsurgical procedure and endovascular interventional techniques.', NULL, NULL, NULL, true);
