INSERT INTO designs VALUES (834168, 'NCT03203226', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'Participants will be recruited at a company which provides supported employment. The primary recruitment strategy will be the information provided to the potential participants and legal guardians by the medical staff of the company. Informed consent will be obtained from the participants and their legal guardians. Afterwards they will be randomly assigned (1:1 ratio) by centre through sealedopaque envelopes to either the control or the intervention group by coin-tossing sequence generation.It has been designed an experimental multicentre simple randomized study, with random allocation to a control group (CG) or to an experimental group (EG). This study is an open-label trial as the assessors who were experienced specialist in working with people with ID (psychologists, nurses, physicians, physiotherapists) are not blinded to group allocation.', NULL, NULL, NULL, NULL);
