INSERT INTO designs VALUES (834626, 'NCT03197272', 'Randomized', 'Single Group Assignment', NULL, 'Treatment', NULL, 'Single', 'The participants are not aware which eye will receive the homogeneous zone treatment and which eye will receive the ring-shaped treatment.', 'Prospective, single-masked intraindividually comparing randomized controlled trial. Participants will be randomized to receive ultraviolet (UV) light according to protocol A in one eye and protocol B in the other, which is masked to the participant. Both eyes will be treated during the same visit.Protocol A: UV irradiation in a central 4 mm homogenous zone of the cornea. Protocol B: UV irradiation in a central ring-shaped 4 mm area of the cornea. Patients are randomized utilizing a computer list of unique random numbers between 1 and 120; an even number will be treated with a homogeneous zone in the right eye; an uneven number with a homogeneous zone in the left eye.', true, NULL, NULL, NULL);
