INSERT INTO designs VALUES (834891, 'NCT03193827', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Double', NULL, 'Two hundred and sixty-eight patients undergoing surgery are randomised 1:1 to in-line filtration (study group) and standard care (control group). For patients randomize to in-line filtration, in-line filters (Pall, Dreieich, Germany) are used during anaesthesia and the following 96 postoperative hours. Patients randomize to standard care (control group) are managed without an in-line filter and according to local routine practice for intravenous drug administration in the adult patient. The incidence and severity of phlebitis are evaluated using the Visual Infusion Phlebitis (VIP) Score23 every 12 hrs from the end of surgery until 96 hrs postoperatively in both groups. Time and severity of phlebitis and time and causes for venous cannula removal are all compared between groups.', NULL, true, true, NULL);
