INSERT INTO designs VALUES (835587, 'NCT03184779', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Double', 'Participants (including the teachers and students) will not be told by the research team if the video assigned to their class is the control or intervention. During the consent process though, they will be made aware that they are going to be randomly assigned to either the control or intervention video.Furthermore, when the two observers go to the ski hill to collect data on observed unsafe behaviours, they will be blinded to the intervention/control status of the school at the ski area that day to prevent observer bias.', 'Schools will be stratified by grade and half of the schools in each stratum will be randomly assigned to the intervention and the other half will be assigned to the control group. Stratification by grade is necessary to ensure that groups are similar enough to ensure less biased comparisons. The research team will also ensure that schools going on their outing to COP on the same day are assigned to the same group. This is to ensure that research assistants can assume that all students observed on the hill for that particular day have the same intervention or control status since it may be challenging to distinguish which school group each student belongs to strictly through observation. That way the research team can accurately ascertain the intervention and control status of each student for the behavior observation component of the study.', true, NULL, NULL, true);
