INSERT INTO designs VALUES (1168104, 'NCT03346616', 'Randomized', 'Parallel Assignment', NULL, 'Other', NULL, 'None', NULL, 'Participants were randomly assigned to a Texting Group or a Non-Texting Group using a random number generator. The texting group received a daily text message containing a board style multiple choice question. If the participant wanted immediate feedback, the message contained a link to a website containing the answer to the question along with an explanation, the source material, and a more complete clinical vignette. One hour after the initial text message was sent, a follow up "answer" text message was delivered. Text messages were sent 6 days per week (Monday through Saturday) at 2pm and 3pm. To minimize perceived impropriety, the non-texting group received access to the journal articles from which the content was derived, but did not receive any text messages or any of the synthesized material. The primary outcome was performance on the NBME Pediatric Subject Examination.', false, false, false, false);
