INSERT INTO designs VALUES (836422, 'NCT03173911', 'Randomized', 'Parallel Assignment', NULL, 'Other', NULL, 'Single', NULL, 'Randomized clinical trial where participants will be allocated into four intervention groups: G1 (n = 12) will receive therapeutic elastic bandage by the Therapy Taping® method (BET) in the ankles; G2 (n = 12) will receive the application of the BET in the lumbar region and G4 (n = 12) will receive the application for all the strategies. The individuals'' balance will be evaluated in four moments: pre-intervention (Pre), immediately (Ime), 24 and 48 hours after intervention (24h and 48h). The main equilibrium parameters analyzed will be: ellipse area (95%) of COP in square centimeters (A-COP in cm2), average speed in centimeters per second (VM in cm / s) and average frequency in Hertz (FM in Hz) Of COP oscillations in the anterior-posterior (A / P) and mid-lateral (M / L) directions, during three postural control tasks: open-eye semitandem (STOA) and right and left unipodal support (UNPD And UNPE).', true, NULL, NULL, NULL);
