INSERT INTO designs VALUES (837364, 'NCT03161652', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Triple', 'Patients, care providers, and evaluators are blind to treatment allocation. This reduces the risk of bias in the measurement of outcomes, in the decision to modify or discontinue treatment, or to withdraw from trial or from analysis. The monitoring coordinator allocates the treatment.', 'The study investigates a medication causing hyperprolactinemia (levosulpiride) to treat diabetic retinopathy (DR) and diabetic macular edema (DME). Subjects are from four different populations, those with DME, non-proliferative DR, those undergoing vitrectomy due to proliferative DR, and those with DME plus standard intravitreal antiangiogenic therapy with ranibizumab. Immediately after baseline, each of the four groups are randomly split into two subgroups: one receiving placebo (sugar pill) and the other levosulpiride. Ophthalmologic and health outcomes between groups 1 and 2 (DME: placebo and levosulpiride), 3 and 4 (DR: placebo and levosulpiride), and 7 and 8 (DME plus ranibizumab: placebo and levosulpiride) evaluate the efficacy and safety of the study medication. Comparison of serum and vitreous prolactin levels between the groups undergoing vitrectomy (DR: placebo and levosulpiride) serve as a proof of principle that prolactin enters the eye to counteract disease progression.', true, true, NULL, true);
