INSERT INTO designs VALUES (839362, 'NCT03135639', 'Randomized', 'Crossover Assignment', NULL, 'Basic Science', NULL, 'Double', 'This is a double-blind study, meaning that neither the participant nor the experimenter knows what kind of stimulation the participant is receiving. An unblinded monitor (separate from the staff that interacts with the participant) is responsible for creating the stimulation codes that run each session and for ensuring that these codes worked correctly.', 'Each participant will receive sham stimulation or stimulation at their individual alpha frequency (8-12 Hz) during a study visit. The order is randomized (i.e., half of participants will receive sham stimulation during the first stimulation session and half will receive sham stimulation during the second stimulation session).', true, NULL, true, NULL);
