INSERT INTO designs VALUES (839383, 'NCT03135366', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', NULL, 'We will employ a randomized controlled trial (RCT) with 600 patients included in the treatment group and 600 patients included in the control group. We have selected this methodology for the following reasons:RCTs are the gold-standard for providing evidence-based evaluation of medical interventions, and recommended when feasible.Keheala is a new program, and cannot be studied using existing data.We are working with researchers from Harvard''s Program for Evolutionary Dynamics and Yale''s Human Cooperation Lab, who have an established record of designing large-scale RCTs in real-world settings such as ours.This sample size was chosen to achieve 80% power in detecting improvements of 7.5% or more in the relevant health outcomes. To do this calculation, we employed Monte Carlo simulations of patient outcomes, based on the Kenyan Ministry of Health''s 2013 TB Case Findings Report.', NULL, true, NULL, true);
