INSERT INTO designs VALUES (840428, 'NCT03121781', 'Randomized', 'Crossover Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'Randomization will be done by sealed envelopes, ready for use once consent is obtained.Each envelope will contain a card with the assigned treatment group: protocol 1 or protocol 2.Protocol 1: we start the study on CPAP with binasal prongs. Edi will be recorded while the infant is on nasal CPAP with the binasal prongs, with a PEEP of 5-8 cm H2O, for 2 hours. Then, the infant will be switched the interface to the RAM cannula, with a PEEP 2 cmH2O higher, during 2 hours.Protocol 2: we start the study on CPAP with RAM cannula. Edi will be recorded while the infant is on nasal CPAP with the RAM cannula with a PEEP 2 cmH20 higher than the levels the infant was receiving before starting the study protocol, for 2 hours. Then, the infant will be switched the interface to the binasal prongs with a PEEP between 5-8 cmH2O, during 2 hours.', NULL, NULL, NULL, NULL);
