INSERT INTO designs VALUES (840610, 'NCT03119415', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'This research is a comparison between the Cooperative Learning program and services as usual. Approximately twelve middle schools will be randomized to a waitlist-control condition. The intervention group will receive training in Cooperative Learning immediately and the waitlist-control group will receive training at the end fo the project. Teachers will be given training on the basics of Cooperative Learning and will be supported in their efforts to implement it in their classrooms. No curricular changes will be required. The initial training will last two or three days and will confirm to the professional development calendar of the intervention schools (selected at random). The implementation of Cooperative Learning is expected to be on-going for the full duration of the project (two years).', NULL, NULL, NULL, NULL);
