INSERT INTO designs VALUES (840821, 'NCT03116672', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Single', 'Patient selection.Fifty-four of sixty-five patients (29 women and 25 men), 18 to 60 years of age with 54 eligible teeth consented to participate in the study. The patients were randomly divided into three groups using a web program. The patient number and group number were recorded. Informed consent was obtained from each patient and the possible discomforts and risks were fully explained.A total of 54 patients were divided into three groups (n = 18) according to the type of preoperative drug administrated, as follows: Group A: Administration of ketorolac 10mg, Group B: Administration of Diclofenac Na 50mg, and Group C: A placebo (capsule filled with sugar).After 15 minutes each participant received the treatment.', 'Patient selection.Fifty-four of sixty-five patients (29 women and 25 men), 18 to 60 years of age with 54 eligible teeth consented to participate in the study. The patients were randomly divided into three groups using a web program. The patient number and group number were recorded. Informed consent was obtained from each patient and the possible discomforts and risks were fully explained.A total of 54 patients were divided into three groups (n = 18) according to the type of preoperative drug administrated.', true, NULL, NULL, NULL);
