INSERT INTO designs VALUES (841236, 'NCT03111264', 'Randomized', 'Factorial Assignment', NULL, 'Prevention', NULL, 'Single', 'One third of recruited childcare centers (control) will not receive any intervention (EWE nor EFE). The remaining two-thirds of the recruited centers will receive the Enhancing Wellness Environment (EWE) intervention, of those, one third will also receive the Enhancing Family Environment (EFE) and one third will not.', 'The investigators will examine the impact of an Enhancing the Childcare Center Wellness Environment (EWE) intervention individually and combined with an Enhancing the Family Environment (EFE) intervention versus control on a) child-care center staff wellness-related attitudes and behaviors; b) parent wellness-related attitudes and behaviors; and c) child food tasting, food preferences, growth, and PA/eating behaviors.', true, NULL, NULL, NULL);
