INSERT INTO designs VALUES (841244, 'NCT03111160', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'Based on the review of literature, we regarded SMILE using energy levels of 115 nJ or higher as ''conventional'' energy-SMILE (C-SMILE). Since 500kHz VisuMax femtosecond laser used in this study had a threshold photodisruption energy level of 100 nJ, lowest energy level of L-SMILE was set at 100 nJ. Because the spot distance must be changed by approximately 1 m when laser energy changed by 50 nJ, we could set the maximum laser energy to 150 (100 + 50) nJ as highest one of C-SMILE while keeping the spot distance constant. Finally, we established two groups divided by different laser energies: L-SMILE group using lower energy levels of 100, 105, and 110 nJ, and C-SMILE group using ''conventional'', not higher, energy levels of 115 to 150 nJ.', NULL, NULL, NULL, NULL);
