INSERT INTO designs VALUES (841776, 'NCT03104218', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Triple', 'A randomisation list will be established prior to the initiation of the study using a random number generator. The randomisation list will be generated by an independent research assistant not involved in data collection. Allocation will be concealed in sealed and opaque envelopes that will be sequentially numbered. Randomisation will be stratified to ensure balance of the treatment groups with respect to sex. A blocked randomisation will also be used to make sure that two equal groups of 20 participants are obtained. Given that it is possible to blind the treating PT, the participants and the evaluators, a triple-blind design will be used. An independent research assistant from the CIRRIS will open the randomisation envelope indicating the participant''s assignment. The research assistant will be blind to the baseline evaluation results. The research assistant will be the one who will set-up the parameters on the tDCS before treatment sessions with tDCS (real or sham tDCS).', 'This triple-blind (patients, therapist & evaluator), parallel-group RCT will include four evaluation sessions over 3 months (baseline, week 3, week 6, 3-month) and 8 supervised physiotherapy treatments during a 6-week rehabilitation program (3 sessions the 1st week, 2 sessions the 2nd weeks, 3 session in the last 4 weeks). Thereafter, participants will be randomly assigned to one of two intervention groups, and then take part in their assigned 6-week intervention. At week 3, 6, and 12, the self-administered questionnaires will be re-administered, while US measurements will only be re-evaluated at week 6.', true, true, NULL, true);
