INSERT INTO designs VALUES (842355, 'NCT03096691', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'None', NULL, '100 pregnant women with a preterm delivery history and / or a cervical length of less than 25 mm will be included among the pregnancies between 16 and 24 weeks of gestation referred to obstetric and perinatology clinics. Information about the use of disease pessaries and treatment success in preventing premature birth of the pessary will be provided. Urine culture and cervical culture samples will be taken from both groups of patients. In the presence of infection, the patient''s treatment will be planned and out of work. If no infection is detected and the patient agrees to use the pessary, the pessary will be used to prevent premature birth.', NULL, NULL, NULL, NULL);
