INSERT INTO designs VALUES (842471, 'NCT03095183', 'Randomized', 'Parallel Assignment', NULL, 'Device Feasibility', NULL, 'Triple', 'Using a computer-generated simple randomization sequence in permuted blocks of 10, numbered study packets that include the surveys and tongue depressor will be prepared in advance. The packets, which will be prepared by a third party not participating in this research study, will include the information sheet, surveys for the investigator, participant and parent, all labeled with the sample number, and a tongue depressor within original packaging. The randomization key will be kept by the third party until the completion of data collection, at which time it will be given to the PI.', 'All patients registered for evaluation in the Brooke Army Medical Center Pediatric Emergency Department will be screened by evaluation of age, mental status, physical features and history of immunocompromised by the PI or AI as part of their standard triage and care procedures for their evaluation and treatment in the Emergency Department. Potential participants will be identified by the PI and AI from patients who are registered to be seen by the PI or AI. Potential participants who meet the inclusion criteria and who have none of the exclusion criteria will be approached prior to completion of the posterior oropharynx exam for permission to enroll them in this study.', true, true, true, NULL);
