INSERT INTO designs VALUES (843429, 'NCT03082716', 'Randomized', 'Parallel Assignment', NULL, 'Other', NULL, 'Triple', 'Blinding :Surgeons will know the type of cardioplegia in the OR while other assessor will be blinded .', 'Randomisation :Computer generated randomisation into two groups based on cardioplegia solution .if randomised to blood patient will receive blood cardioplegia, delivered by microplegia delivery system by adding potassium to the blood (K= 35 ml eq/L) . The initial dose will be 35ml/ kg, and subsequent doses 20-15 ml/kg given every 20 minutes at a Temperature of 10 - 15 °C, while maintaining a perfusion pressure of 100-125 mmHg.if randomised to custodial patient will receive single dose of HTK custodiol cardioplegia. at temperature of 4-8°C and will be perfused for 6-8 minutes. Dose will start from 400 up to 1000 ml according to the child''s body weight. Perfusion pressure will be kept at 70 - 80 mmHg until the heart is arrested.', true, NULL, true, true);
