INSERT INTO designs VALUES (844620, 'NCT03067207', 'Randomized', 'Sequential Assignment', NULL, 'Supportive Care', NULL, 'Single', 'This study will be a single-blinded study (investigators only). Participants will be coded using Arabic numerals. A research assistant will receive all questionnaires and cortisol samples. Mindfulness facilitators will be unaware of participant identification numbers. Participants will be assigned to one of four groups (experimental arm) or to one of two groups (feasibility arm) following a computer-generated randomization list (permuted block design, using blocks of two or four). The allocation sequence will be generated by a statistician not otherwise involved in the project and passed on to a research assistant after patient identification data has been collected (ensuring that the investigators are kept blind to the allocation of each participant). Allocation sequence will be password-protected and only accessible by the statistician and research assistant.', 'The study will be conducted as a longitudinal randomized non-inferiority trial comparing two arms: an experimental arm and feasibility arm. Participants living close enough to commit to in-person sessions will be entered in the experimental arm of the study. The feasibility arm, which will only take place if the targeted number of study participants (60) is not reached for the experimental arm, will be offered to participants who are not able to commit to the in-person mode of delivery. It will consist of two groups, one early e-health group and one wait-list e-Health group. At the end of the recruitment period, once participants have been placed in the experimental and feasibility arms, two separate randomizations will take place. The first randomization (experimental arm) will serve to assign participants to one of the four experimental groups and the second randomization (feasibility arm) will assign participants to one of the two feasibility groups.', NULL, NULL, true, NULL);
