INSERT INTO designs VALUES (844726, 'NCT03065829', 'Randomized', 'Parallel Assignment', NULL, 'Supportive Care', NULL, 'Double', NULL, 'Our model posits that effective caregiver self-management depends on analytic and emotional processing. The investigators hypothesize the ASSIST intervention will improve analytic processing by improving self-monitoring. ASSIST will expose subjects to mindfulness meditation training and promote self-awareness, which will aid the regulation of their emotional processing and improve proximal outcomes. The investigators expect proximal self-management outcomes to influence the distal outcomes of caregiver health. Our model will also test the mediating effects of decentering, processing, the hypothalamic-pituitary axis (HPA), inflammatory stress response, and cognitive mediators. The influence of potential moderators will be assessed for their effect on the relationship between the self-management intervention and the proximal and distal outcomes.', true, NULL, true, NULL);
