INSERT INTO designs VALUES (845204, 'NCT03059693', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Quadruple', 'The Sponsor will send all washout and test products in compliance with current Good Manufacturing Practices directly to the clinical facility prior to the start of the study. Study procedures will be in place to ensure double-blind administration of study treatments. Access to the randomization code will be strictly controlled. The quantity of all study material shipped to the clinical facility will be documented on the shipping and receiving form included within the shipment. Due to the objectives of the study, the identity of test and control treatments will not be known to investigators, care provider, outcomes assessor, research staff, or patients. Packaging and labeling of test and control treatments will be identical to maintain the blind. Products will be identified with the codes generated by the randomization.', NULL, true, true, true, true);
