INSERT INTO designs VALUES (847124, 'NCT03034655', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Double', 'After the first screening visit, the patients who grant their consent will be included in the study and randomised to one of the following study arms. Randomisation will be performed by C.H.U de Santiago Clinical Epidemiology and Biostatistics Unit. Once the informed consent form is signed, the care provider will contact the unit, which will give him the code of the arm to which the patient is assigned. A n= 20 block balanced randomisation sequence will be used. The investigator will analyse results and evolution, being blind type and duration of vestibular rehabilitation.', 'Experimental study, single-center, open, randomized (balanced blocks of patients) in four branches in parallel, in 220 elderly patients (over 65 years) with high risk of falls; follow-up period: twelve months.', NULL, NULL, true, true);
