INSERT INTO designs VALUES (847357, 'NCT03031626', 'Randomized', 'Crossover Assignment', NULL, 'Supportive Care', NULL, 'Triple', 'The split-night polysomnograms (Arm A, Arm B) will be scored by two independent sleep technologists Three independent sleep physicians will be involved in each case; 1 to perform the initial consult in the sleep clinic, a 2nd to interpret the baseline PSG, and a 3rd to interpret the split-night PSG (with oxygen and medical air). Arm A and Arm B will be analyzed blindly.', 'The screening visit will occur during a regularly scheduled clinic visit. The patients that have consented for the study will all undergo the baseline PSG. Only patients with clinically significant CSA after Visit 1 will undergo randomization and complete Visit 2.Those who have a CAHI greater or equal to 5 will be randomly assigned to Arm A or Arm B. Randomization will be performed using a computer with random numbers drawn. Arm A will receive Medical Air followed by Oxygen and Arm B will receive Oxygen followed by Medical Air.', NULL, true, true, true);
