INSERT INTO designs VALUES (1196581, 'NCT03362567', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'The study involved 47 patients with cervical radiculopathy which were purposively recruited from the Physiotherapy Department Outpatient Clinic of Usmanu Danfodio University Teaching Hospital, Sokoto for the study. Subjects were randomly allocated to Sustained Natural Apophyseal Glides (SNAGS)and Mechanical Cervical Traction (MCT) group. All the subjects were treated using cryotherapy for seven minutes. Subjects in SNAGS group were then treated with sustained natural apophyseal glides, twice weekly for six weeks while subjects in MCT received mechanical cervical traction, for 15 minutes each session twice in a week for six weeks. Visual analogue scale, neck disability index questionnaires and inclinometer were used to assess pain intensity, disability and cervical range of motion respectively at the beginning, 3rd and 6th week of treatment', false, false, false, false);
