INSERT INTO designs VALUES (1196711, 'NCT03360877', NULL, 'Single Group Assignment', NULL, 'Prevention', NULL, 'None', NULL, 'The initial 8-month baseline period will be used to collect data on the evaluation criteria of interest prior to the administration of any intervention of the study and will develop appropriate pedagogical tools to support the uptake of each cleaning strategy during subsequent intervention periods. After the reference period, a one-month introductory period will allow the organization of the first intervention at each site (ie - a soap and water cleansing administered by the carers in a structure or - a cleaning HCG administered by caregivers in the other facility) followed by eight months of active follow-up of the study with the first intervention. Following the eight months of active follow-up with the first intervention, there will be a crossover with an introductory period of one month and eight months of active follow-up with the other intervention. A final period of interruption will occur during the last eight months of the study.', false, false, false, false);
