INSERT INTO designs VALUES (1196737, 'NCT03360539', 'Randomized', 'Single Group Assignment', NULL, 'Supportive Care', NULL, 'None', NULL, 'The Nurse-Family Partnership (NFP) was launched by pediatrician David Olds in the early 1970s in response to the observation that low-income mothers are less likely to engage in positive health and parenting behaviors that are associated with better child development outcomes (Olds et al. 1986). NFP is a prenatal and infancy home visiting program for low-income, first-time mothers and their families. Registered nurses begin visiting their clients as early in the pregnancy as possible, helping the mother-to-be make informed choices. The nurses continue visiting regularly until the child is two years old.', false, false, false, false);
