INSERT INTO designs VALUES (1187824, 'NCT03354845', 'Randomized', 'Parallel Assignment', NULL, 'Other', NULL, 'Single', 'Group assignment was made known to the pharmacists and doctors involved in the deprescribing study intervention. However, patients were not aware of which group they had been assigned to.', 'The study was conducted as an open trial with two parallel groups. A total of 200 patients were randomized to an intervention (deprescribing) or control (usual care) group in a 1:1 ratio. Randomization of patients was performed after recruitment by an independent administrator using GraphPad randomization sequence software ©2017. Doctors were free to make any changes to patients'' medication regimens as they wished in both groups.', false, false, false, false);
