INSERT INTO designs VALUES (860019, 'NCT02866708', 'Randomized', 'Crossover Assignment', NULL, 'Treatment', NULL, 'Single', 'Two experienced outcome assessors/outcome adjudicators (certified wound nurse or physician or wound trained health care specialist) will assess the wound photographs using Photographic wound assessment tool (PWAT 0-24 score). At least one of the PWAT assessors will be blinded to the study group''s assignments, and will not be involved in the study otherwise (intervention or in the standard wound care).', '16 week crossover pilot study comparing intermittent negative pressure (40mmHg) applied to the lower leg and foot plus standard best practice wound care comapred to standard best practice wound care alone.', NULL, NULL, NULL, true);
