INSERT INTO designs VALUES (873359, 'NCT02692807', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'This is only for the RCT Study - the double-blinded study. The HARP study consists of only a prospective longitudial study With same outcome measure and follow-ups; hence, given 3 arms. The below "Allocation" and "Number of Subjects" is ONLY for the RCT part of the study', 'The RCT part of the HIPARTI Study has 2 arms, but there is also a prospective longitudinal study of those who are either not willing to participate in the RCT, or where the study takes part in collaborating countries were there is ONLY the prospective longitudial ongoing (Australia). This part of the study is the HARP study. The HIPARTI consists on one RCT trial eith two parallel arms, and one prospective cohort, the HARP study.', true, NULL, NULL, true);
