INSERT INTO designs VALUES (884955, 'NCT02541474', 'Non-Randomized', 'Parallel Assignment', NULL, 'Health Services Research', NULL, 'Double', 'This is a registry based study design. The Primary outcome is extracted from routine data recorded by clinical and administrative personell who are unaware of study allocation in the electronic health care record.The questionnaire outcome data can not be masked as the patient and study personell will be aware of treatment allocation group. To avoid preferential recording of these outcomes, study personell assist in data collection in either treatment or control groups - never both, so that they could not compare or favor one group above the other.', 'Treatment patients', NULL, NULL, true, true);
