INSERT INTO designs VALUES (1157384, 'NCT03235947', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Quadruple', NULL, 'This is a randomized, parallel-group, controlled clinical trial conducted in a single center that will include renal transplant recipients over the age of 18 to assess the efficacy and safety of disodium fosfomycin in the perioperative period of renal transplantation. The intervention group will receive intravenous fosfomycin 4 g disodium three hours prior to: renal transplant surgery, removal of the urinary catheter and withdrawal of the ureteral catheter. The control group will receive placebo at the same time. Both groups will receive standard prophylaxis consisting of trimethoprim / sulfamethoxazole (160/800 mg) orally every 24 hours when the GFR is greater than 30 mL / min / 1.73m2.', false, false, true, true);
