INSERT INTO designs VALUES (1140952, 'NCT03185689', 'Randomized', 'Parallel Assignment', NULL, 'Supportive Care', NULL, 'None', NULL, 'DSME is model assumed to empower diabetes patients in the area of self-care practice. To bring this behavioral change it has been hypothesized that an intensified DSME which is given in organized, interlinked and supported by take home activities is effective in glycemic control. As a teaching material, illustrative booklet was prepared in two local languages. Similarly, fliers have been given following each DSME session. Specifically for educational sessions, copy of the booklet was prepared in larger posters. The education is not only one way type of education, rather there have been a vast experience sharing among the patient, whether they have been doing in the recommended way or not. Then the facilitator educate them what is right and recommended. Local culture, values and beliefs were taken into account on each of the sessions.', false, false, false, false);
