INSERT INTO designs VALUES (1141114, 'NCT03045133', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Quadruple', 'Group assignments were sealed in sequentially numbered opaque envelopes that were opened after patient inclusion in the study. All care providers, researchers, and patients were blinded to group assignments. Study 10-mL syringes will be prepared by an anesthesiologist independent of the study. Methadone 0.1 mg.kg-1 (made up to 10 mL with normal saline) or morphine 0.1 mg.kg-1 (made up to 10 mL with normal saline) will be drawn into each syringe which will be offered to the anesthesia provider after the opaque envelope is opened.The baseline QoR-40 questionnaire will be provided to subjects after informed consent is obtained in the preoperative holding area and 24 hours after surgery by a blinded investigator.', 'Prospective, randomized, double-blinded trial', false, false, true, true);
