INSERT INTO designs VALUES (1116716, 'NCT02731573', 'Randomized', 'Parallel Assignment', NULL, 'Prevention', NULL, 'Single', NULL, 'Phase Ib/II, Prospective, Multicenter, Two part study; Part 1 Open Label, Single arm & Part 2 Randomized, Single-blinded, D-PLEX Concomitantly with Standard Of Care vs. Standard of Care alone.Study population include subjects above the age of 18 years, that undergoing cardiac surgery through mid-sternotomy, including patients with high risk of infection, such as diabetes (Insulin and/or non-insulin dependent), patients with Peripheral Vascular Disease (PVD), Chronic Obstructive Pulmonary Disease (COPD), heavy smokers, Bilateral Mammary artery harvesting, and subjects administered chronic steroid treatment.Subjects who meet the eligibility criteria and provide signed informed consent, will be enrolled into the study and will be treated with D-PLEX concomitantly with standard of care (part 1) or randomized 2:1 to D-PLEX concomitantly with standard of care vs. standard of care only (part 2).', false, false, false, false);
