INSERT INTO designs VALUES (1126760, 'NCT03313349', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Triple', 'Participants in the study are allocated to each arm by using randomization system. After determining which of the three school Units the student will attend, the participants are distributed in to one of the two arms at each school (UP & ENP).It is not possible to fully blind parents and students as they have to give informed consent. Teachers and social workers will be kept blind to allocation as far as possible . They are not directly involved in the treatment measured in this study, even though they play a great part in it. The blindness of the teachers and social workers is important as they will be providing the ratings used in the analyses.', 'Design: A pragmatic RCT designed according to CONSORT guidance (CONSORT, 2010) to compare UP and ENB.Students, attending the schools, were randomly allocated to either UP or ENP according to a one-to-one ratio. Outcome measures (see below) were collected at pre-intervention (T1), post-intervention (T2 - 3 months post randomization) and follow up (T3 - 6 months post randomization). If possible, the a last follow up (T4 - 12 months post randomization).', false, false, false, true);
