INSERT INTO designs VALUES (1151913, 'NCT03334955', NULL, 'Single Group Assignment', NULL, 'Treatment', NULL, 'None', NULL, 'Laparoscopic ovarian drilling was performed under general anesthesia with good muscle relaxation and endotracheal intubation using the three-punctures technique (one puncture 10mm at the umbilicus and the other two punctures 5mm at both iliac fossa) in the early follicular phase. A specially designed monopolar electrocautery probe was used to penetrate the ovarian capsule at 4 points (regardless of the size of the ovary), with the aid of a short burst of monopolar diathermy. The probe (which has a distal stainless steel needle measuring 10 mm in length and 2 mm in diameter) was applied to the surface of the ovary at a right angle to avoid slippage and to minimize surface damage. A monopolar coagulating current at a 40 W power setting was used. The needle was pushed through the ovarian capsule for about 4 mm depth into the ovarian tissue and electricity was activated for 4 seconds. The ovary was then cooled using 200 ml crystalloid solution before releasing the ligament.', false, false, false, false);
