INSERT INTO designs VALUES (1130586, 'NCT03187041', NULL, 'Single Group Assignment', NULL, 'Basic Science', NULL, 'None', NULL, 'In order to acquire our data, a Microlab PicoPress device will be employed. It has been shown to provide accurate, linear, and reproducible measures of surface pressure between the skin and device. For tourniquets, the investigators will be using a MedSource perforated tourniquet, which is the type of elastic tourniquet the phlebotomists are accustomed to using in their daily practice. For each experiment throughout both phases of the study, the PicoPress pressure sensor will be folded in half and taped over the lateral aspect of the right arm, approximately 2 inches distal to the deltoid muscle along the brachialis muscle. Arm circumferences will be taken prior to experimentation at this same location. For each trial, the phlebotomists will tie the 2.5cm elastic tourniquet around the arm and pressure sensor while ensuring that the tourniquet is not knotted directly on top of the sensor. The study will be divided into two phases of experimentation conducted sequentially.', false, false, false, false);
INSERT INTO designs VALUES (1152673, 'NCT03233113', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Single', 'Pre-determined condition allocation was listed in an Excel spreadsheet and concealed with black cell masking color. Interested individuals who met initial eligibility criteria during a pre-enrollment phone screening were entered in the order of screening in the assignment Excel spreadsheet (that was already masked to conceal condition assignment). Only the participant''s therapist viewed the allocated condition immediately prior to the first treatment session by temporarily lifting the cell mask.', 'The current study follows a two-arm, parallel group RCT study design. Participants are randomized to either the active control arm (Exposure and Response Prevention) or the experimental arm (Exposure with Judicious Safety Behaviors). Participants are not offered the opportunity to choose their study condition, nor are they provided with an explanation of the difference between their assigned treatment arm and the alternative treatment arm. Randomization was achieved prior to initial participant recruitment via a random number generator with the condition that an equal number of participants be randomized to each condition.', false, false, false, true);
INSERT INTO designs VALUES (1130650, 'NCT03161639', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Quadruple', 'At the end of the canal access, the first operator will leave the surroundings and a second operator will continue. A length measurement will be determined in order to define the working length. After the working measurement length performed by the second operator, the first operator will be informed about the working length of each canal without the knowledge of which method was used for the length measurement . From then on, the first operator will continue the endodontic treatment. A third operator will evaluate the outcomes.', 'Patients between 6 and 9 years old who search for endodontic treatment in primary teeth. The allocation of subjects to groups will be achieved by randomization. These patients will be randomly divided into 2 groups: G1 - pulpectomy with length measurement performed through radiography and G2 - pulpectomy with length measurement performed with the aid of an apex locator.', false, false, true, true);
