INSERT INTO designs VALUES (1130822, 'NCT03100981', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Double', 'Assessors performing introduction calls are masked in the sense that participants will not be randomized until after the introduction call. All questionnaires are completed as online surveys and are hence masked for group allocation.', 'After baseline assessment, participants will be randomly assigned to either the intervention or the control group. Both groups will receive online questionnaires at 5 weeks (midway), 10 weeks (post treatment) and 36 weeks (6 months follow-up) after baseline assessment.The intervention group receives a therapist phone call prior to enrollment in the internet-delivered treatment and then participates in 8 weeks of therapist-assisted internet-delivered Mindfulness-Based Cognitive Therapy. The internet-delivered treatment also comprises weekly distress measures, including suicide risk screening, and assessment of working alliance at week 2, 4, and 7 of the course.', false, false, true, true);
