INSERT INTO designs VALUES (1208517, 'NCT03164252', 'Randomized', 'Parallel Assignment', NULL, 'Treatment', NULL, 'Quadruple', 'Surgical procedures were always performed by the same surgeon and assistant, who were unaware of the surrogate group that belonged to the patient, as well as the patient himself. This randomization was performed involving numbers and envelopes, being only the investigator''s knowledge.', 'The sample of this study will be composed of 60 patients between 16 and 40 years old, who need to undergo the extraction of third molars included and / or impacted. The patients will be those who voluntarily seek the Discipline of Buccomaxillofacial Surgery and Traumatology, at the State University of São Paulo "Júlio de Mesquita Filho" - Unesp, to perform the procedure.This study will be a randomized, double-blind, prospective clinical trial with the following groups:Group I (with 20 patients) - laser therapy used in the immediate postoperative period will be intraoral irradiation with 660 nm red diode laser, 30 mW power and 10 J / cm2 fluency.Group II (with 20 patients) - laser therapy used in the immediate postoperative period will be intraoral irradiation with 660 nm red diode laser, 30 mW power and 30 J / cm2 fluency.Group III (with 20 patients) - Control Group - Application of laser sham.', false, false, true, true);
