INSERT INTO designs VALUES (1161113, 'NCT03341091', 'Randomized', 'Parallel Assignment', NULL, 'Supportive Care', NULL, 'Single', 'An independent assessor who was blinded to group allocation assessed the participants'' motor performance variables.', 'A two-arm parallel (single-blinded) cluster randomised controlled trial involves two groups of participants (Tai-chi and the control group). Four community health centers that provide dementia care services were recruited through convenience sampling and each was viewed as one cluster and was randomised to either the Tai-chi or the control group, based on computer-generated random numbers. So during the trial, participants in one group receive Tai-chi group programme "in parallel" to participants in the other group, who took part in group recreational activities and continue their usual lifestyles and levels of physical activity.', false, false, false, true);
